import { Routes, Route, Navigate, useLocation } from 'react-router-dom';
import Login from './components/Login';
import Clientes from './components/Clientes';
import Principal from './components/Principal';
import PorCobrar from './components/PorCobrar';
import PorPagar from './components/PorPagar';
import PrivateLayout from './components/PrivateLayout';

function App() {
  return (
    <div className="App">
      <Routes>
        {/* Rutas p√∫blicas */}
        <Route path="/login" element={<Login />} />

        {/* Rutas privadas dentro del layout con SideNav */}
        <Route
          path="/"
          element={
            <PrivateLayout>
              <Navigate to="/principal" replace />
            </PrivateLayout>
          }
        />
        <Route
          path="/clientes"
          element={
            <PrivateLayout>
              <Clientes />
            </PrivateLayout>
          }
        />
        <Route
          path="/principal"
          element={
            <PrivateLayout>
              <Principal />
            </PrivateLayout>
          }
        />
        <Route
          path="/porcobrar"
          element={
            <PrivateLayout>
              <PorCobrar />
            </PrivateLayout>
          }
        />
        <Route
          path="/porpagar"
          element={
            <PrivateLayout>
              <PorPagar />
            </PrivateLayout>
          }
        />
      </Routes>
    </div>
  );
}

export default App;
